import { useEffect, useState } from "react";
import styled from "styled-components";
import BlankTop from '../../components/BlankTop'
import Button from '../../components/Button'
import Logo from '../../assets/logo.png'
const Fix =styled.div`
min-height:100vh;
background-color:  #ffffff;
`;


const Wrapper = styled.div`
  width:110rem;
  height: 100%;
  padding:30px;
  display: flex;
  flex-direction: column;

  margin: 10 auto;
`
const MyIcon = styled.img`
  width:400px;
`;

MyIcon.defaultProps = {
  src: Logo,
};

const Detail=styled.div`
  display: flex;
  flex-direction: row;
  width: 100%;
  justify-content: space-between;
`
const Content=styled.div`
  display: flex;
  flex-direction: row;
  margin-left:7%;
  justify-content: space-between;
`


const Title = styled.div`
    font-family: Lora;
    color:#10375C;
    width:50rem;
    line-height: 10px;
    font-weight:bold;
    font-size: 50px;
`

const MainPage = (match) => {

  return (
    <>
    <Fix>
        <Wrapper>
            <Detail>
            <MyIcon></MyIcon>
            <Button font='12'> 문서요약 </Button>
            <Button font='12'> o,x 문제 </Button>
            <Button font='12'> 빈칸문제 </Button>
            <Button font='12'> 요약검색 </Button>
            <Button font='12'> AI 질의응답 </Button>
            <Button font='12'> 마이페이지 </Button>
            <div></div><div></div><div></div>
            <Button font='12'> Log In </Button>
            <Button font='12' color='white' background='#10375C'> Sign Up </Button>
            </Detail>
            <Content>
            <Title> <p  style={{ color: '#EF746F'  }} >Query-intensive  learning </p>help services  <p/>through document summaries</Title>
            </Content>
      </Wrapper>
      </Fix>
    </>
  );
};

export default MainPage;
